import React from "react";
import { Link } from "react-router-dom";

const columns = [
  {
    name: "Name",
    sortable: true,
    selector: "name",
    cell: (row) => (
      <div data-tag="allowRowEvents">
        <Link
          to={{
            pathname: `cultures/edit/${row._id}`,
          }}
        >
          {row.name}
        </Link>
      </div>
    ),
  },
  {
    name: "Region",
    selector: "region",
    sortable: true,
  },
  {
    name: "Address",
    selector: "address",
    sortable: true,
  },
  {
    name: "Phone",
    selector: "phone",
    sortable: true,
  },
];

export default columns;
